/* ../mca/components/FormValidator.js */
/**
 * FormValidator pour le front-office
 * à passer en Solidify dans le namespace Gato !
 * 
 * @param pForm : le selecteur jQuery du formulaire
 * 
 * Nécessite le composant formValidator
 */
mca.components.FormValidator = function (pForm) {
    /**
     * this : stocker l'objet
     */
    var that = this;

    /**
     * le formulaire
     */
    var form;

    /**
     * Le callback au submit
     */
    var submitCallback;

    /**
     * le callback au change
     */
    var changeCallback;

    /**
     * changeEvent est activé
     */
    var changeEventEnabled;

    /**
     * Les regles
     */
    var rules;

    /**
     * Les validations
     */
    var validations;

    /**
     * Les erreurs
     */
    var errors;

    /**
     * Constructeur du FormValidator
     *  @param pForm : le selecteur jQuery du formulaire
     */
    function __construct(pForm) {
        // Stocker le formulaire
        form = pForm;

        // Initialiser les callbacks
        submitCallback = changeCallback = false;

        // par défault, changeEventEnabled est à false
        changeEventEnabled = false;

        // formValidatorData existe
        if ('formValidatorData' in data) {
            // Stocker les regles
            rules = data.formValidatorData.rules;

            // Stocker les validations
            validations = data.formValidatorData.validations;
        }
    }

    /**
     * Récuperer le champs
     */
    function getItem(pField) {
        // La recherche par défault
        var search = '[name="' + pField + '"]';
        // On split sur le "."
        fieldSearch = pField.split('.');

        // S'il y a plus de 2 éléments.
        if (fieldSearch.length > 1) {
            var field = '';
            for (var i in fieldSearch) {
                if (i == 0) {
                    field += fieldSearch[i];
                } else {
                    field += '[' + fieldSearch[i] + ']';
                }
            }
            search = '[name="' + field + '"]';

            // Vérifier que le premier champs commence par une majuscule
            var regex = new RegExp('^[A-Z]');

            // Le premier caractère est une majuscule. Il faut donc ajouter au selecteur data[MonModele][...]
            if (regex.test(pField)) {
                var field = 'data';
                for (var i in fieldSearch) {
                    field += '\\[' + fieldSearch[i] + '\\]';
                }
                search += ',[name="' + field + '"]';
            }
        }
        var item = form.find(search);
        return item;
    }

    /**
     * Vérifier les données
     */
    function validate(pField) {
        // field par défault à false
        pField = pField || false;

        // boolean de sortie
        var out = true;

        // Initialiser le tableau d'erreurs
        errors = new Array();

        // La validation en cours
        var validation;

        // Parcourir toutes les validations
        for (var i in validations) {
            // Stocker la validation en cours
            validation = validations[i];

            if (pField === false || pField == validation.field) {
                // Vérifier le champs
                if (!checkValidation(validation)) {
                    // Parcourir le tableau des errors et vérifier qu'il n'existe pas d'erreurs
                    var alreadyExist = false;
                    for (var j in errors) {
                        if (errors[j].field == validation.field) alreadyExist = true;
                    }

                    // l'erreur n'existe pas
                    if (!alreadyExist) {
                        errors.push({
                            message: validation.errorMessage,
                            field: validation.field,
                            item: getItem(validation.field)
                        });
                    }
                    out = false;
                }
            }
        }
        // Retourner le boolean
        return out;
    }

    /**
     * Vérifier une validation
     * @returns
     */
    function checkValidation(pValidation) {
        // Créer la regex avec la regle
        var regex = new RegExp(rules[pValidation.rule][0], rules[pValidation.rule][1]);


        // Récuperer le contenu du champs
        var content = getItem(pValidation.field).val();

        // Tester la regex et retourner le résultat
        return regex.test(content);
    }

    function enableChangeEvent() {
        // la validation en cours
        var currentValidation;

        // Parcourir toutes les validations
        for (var i in validations) {
            // Stocker la validation en cours
            currentValidation = validations[i];

            // L'item
            var item = getItem(currentValidation.field);

            var tagName = false;

            // tag name
            if (item.length > 0) {
                tagName = item.get(0).tagName;
            }

            var eventMethod = function (e) {
                // Vérifier la validation du champs en cours
                var isValid = validate();

                // Appeler le callback avec les erreurs
                changeCallback(errors);
            };

            // evenement au change
            item.bind('change', eventMethod);


            // evenement keypress si c'est un input text/pass ou un textarea
            if (tagName == 'TEXTAREA' || (tagName == 'INPUT' && (item.attr('type') == 'text' || item.attr('type') == 'password'))) {
                // Ajouter l'evenement keypress
                item.bind('keyup', eventMethod);
            }
        }
    }

    /**
     * evenement à la validation du formulaire
     * @param pCallback : fonction de retour avec les erreurs en paramètre
     * @param pForce : booléen qui force le passage dans le callback. Dans ce cas, la méthode doit retourner true ou false.
     */
    this.submit = function (pCallback, pForce) {
        // Enregistrer le callback
        submitCallback = pCallback;

        // Boolean de sortie
        var out = true;

        // pForce par défault à false
        var force = pForce || false;

        // Ajouter l'évènement sur le formulaire
        form.submit(function () {
            // Vérifier la validation de tous les champs
            var isValid = validate();

            // Appeler le callback avec les erreurs
            boolCallback = submitCallback(errors);

            // S'il n'y a pas de boolean retourné dans le callback, mettre false par default
            boolCallback = boolCallback || false;

            // le boolean de sortie est retourné par la fonction
            out = boolCallback;

            // Activer le changeEvent la premiere fois que l'utilisateur clique sur le submit
            if (changeCallback !== false && changeEventEnabled === false) {
                // Le changeEvent peut être activé
                enableChangeEvent();

                // passer le boolean changeEventEnabled à true
                changeEventEnabled = true;
            }

            // Si il y a des erreurs ou si le passage est forcé via le 2e paramètre
            if (!isValid || force) {
                /*
				// S'il n'y a pas de boolean retourné dans le callback, mettre false par default
				boolCallback = boolCallback || false;
	
				// le boolean de sortie est retourné par la fonction
				out = boolCallback;
				// si c'est en mode force
				if(force)
				{
					// le boolean de sortie est retourné par la fonction
					out = boolCallback;
				}
				else
				{
					// Le boolean est false
					out = false;
				}*/
            }
            return out;
        });

        return that;
    };

    /**
     * evenement au change sur les input select, etc...
     */
    this.change = function (pCallback) {
        // Par défault le callback du submit()
        changeCallback = pCallback || submitCallback;
    };


    /**
     * Appeler le constructeur si les données sont présentes dans data
     */
    __construct(pForm);
};;

