function verticalAlign()

{

    var timeout;

    $(window).on('resize', function () {

        function set()

        {

            $('.middleParent').each(function () {

                var $this = $(this);

                $this.css('lineHeight', $this.height() + 'px');

            });

        }

        set();

        window.clearTimeout(timeout);

        timeout = window.setTimeout(function () {

            set();

        }, 500);

    }).trigger('resize');

}

function validateForm(elements, e, addConditions, tab) {
    if (tab && tab.length > 0) {
        var tabErrors = tab;
    } else {
        var tabErrors = new Array();
    }

    for (var i = 0; i < elements.length; i++) {
        if ($(elements[i][0]).val() == '') {
            tabErrors.push(elements[i][1]);
        } else {
            $(elements[i][1]).css('border', '2px solid #000');
        }
    }
    for (var i = 0; i < addConditions.length; i++) {
        eval(addConditions[i][0]);
    }

    if (tabErrors.length > 0) {
        e.preventDefault();
        $('.formError').fadeIn();
        for (var i = 0; i < tabErrors.length; i++) {
            $('' + tabErrors[i] + '').css('border', '2px solid red');
        }
        return false;
    } else {
        return true;
    }
}

function validateEmail(email) {
    var re = /^(([^<>()[\]\\.,;:\s@\"]+(\.[^<>()[\]\\.,;:\s@\"]+)*)|(\".+\"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/;
    return re.test(email);
}


