mvc.views.layout = new(function ()

    {

        var that = this;



        // Les anciens controller & action

        this.oldController = false, this.oldAction = false;



        // Les controller courants

        this.currentController = false, this.currentAction = false;



        /**

         * Cacher le contenu

         */

        this.hideContent = function (pCallback) {

            $('.sliderArrows').removeClass('display');

            $('.goBack').removeClass('display');

            var delay = 0;

            var $items = $('#content .layoutHide:visible:onAbsoluteScreen');

            var total = $items.length;

            if (total == 0)

            {

                total = 1;

                $('.layoutHide').remove();

                $('#content > div:first-child').prepend('<div class="layoutHide"></div>');

                $items = $('#content .layoutHide');

            }

            $items.css({

                right: 'auto',

                left: 0

            }).each(function (i) {

                $(this).stop().delay(delay).animate({

                    width: '100%'

                }, 600, 'easeInCubic', function () {

                    if (i == total - 1)

                    {

                        pCallback();

                    }

                });

                delay += 150;

            });

        };



        /**

         * Injecter le contenu

         * @param pData

         */

        this.setContent = function (pData) {

            // Setter les nouveaux controller

            that.currentController = pData.controller;

            that.currentAction = pData.action;



            that.hideContent(function () {

                $('#content > div:not(:last-child)').remove();

                $(window).trigger('resize');

                that.animate();



                // Setter les anciens

                that.oldController = that.currentController;

                that.oldAction = that.currentAction;

            });

            var $content = $(pData.html);

            $content.css({

                visibility: 'hidden',

                opacity: 0

            });

            $('#content').append($content);

            $(document).trigger('layout:inject')

        };


        /**

         * Animate

         */

        that.animate = function () {

            var delay = 0;

            var total = $('#content .layoutHide:visible').length;



            $('#content > div').css({

                visibility: 'visible',

                opacity: 1

            });



            $('.goBack').addClass('display');



            $('#content .layoutHide').stop().css({

                width: '100%',

                left: 'auto',

                right: 0

            }).each(function (i) {

                $(this).stop().delay(delay).animate({

                    width: '0%'

                }, 600, 'easeOutCubic', function () {

                    $(this).css({

                        right: 'auto',

                        left: 0

                    });

                    if (i == total - 1)

                    {



                    }

                });

                delay += 150;

            });

        };

    });;

