/* ../mvc/controllers/brewery.js */
mvc.controllers.brewery = new(function ()

    {

        var that = this;



        this.index = function () {



            that.video();



            if (mvc.views.layout.oldController == 'brewery')

            {

                $('#breweryIndex .introduction').hide();

            } else

            {

                var tl = new TimelineMax({

                    delay: 1,

                    onReverseComplete: function () {

                        TweenMax.to('#breweryIndex .introduction', 1, {

                            scale: 1.2,

                            opacity: 0,

                            ease: Expo.easeOut,

                            onComplete: function () {

                                $('#breweryIndex .introduction').hide();

                            }

                        });

                    }

                });



                tl.staggerFrom($('#breweryIndex .introduction .in .text').find('h2 span, h3, .discover'), 1, {

                    y: 100,

                    opacity: 0,

                    ease: Expo.easeOut

                }, 0.05);



                $('#breweryIndex .introduction .in .text .discover').on(CLICK_EVENT, function () {

                    tl.timeScale(2);

                    tl.reverse();

                });

            }

        };



        this.video = function () {



            if (window.isMobile) return false;



            $(window).on('resize', function () {

                var windowRatio = $(window).width() / $(window).height();

                var videoRatio = 1.77777777777;

                if (windowRatio >= videoRatio)

                {

                    var height = $(window).width() / videoRatio;

                    $('.videos').css({

                        width: '100%',

                        height: height,

                        marginLeft: 0,

                        marginTop: (height - $(window).height()) / 2 * -1

                    });

                } else

                {

                    var width = $(window).height() * videoRatio;

                    $('.videos').css({

                        height: '100%',

                        width: width,

                        marginTop: 2,

                        marginLeft: (width - $(window).width()) / 2 * -1

                    });

                }

            }).trigger('resize');



            /*$('#video').attr('src', $('#video').data('src')).load(function () {

                $('.videosContainer').addClass('displayed');

            });*/





            var interval;

            var duration;

            var player = new YT.Player('video', {

                height: '100%',

                width: '100%',

                videoId: $('#video').data('id'),

                playerVars: {

                    autoplay: 1,

                    controls: 0,

                    showinfo: 0,

                    loop: 1,

                    rel: 0,

                    enablejsapi: 1,

                    wmode: 'transparent'

                },

                events: {

                    onReady: onPlayerReady,

                    onStateChange: onPlayerStateChange

                }

            });



            var done = false;

            function onPlayerReady(event)

            {

                duration = player.getDuration();



                event.target.playVideo();

                event.target.mute();

                if (!done)

                {

                    done = true;

                }



                window.setTimeout(function () {

                    $('#video').addClass('selected');

                }, 300);

            }



            var isFirstVideo = true;



            function onPlayerStateChange(event)

            {

                if (event.data === 1)

                {

                    if (isFirstVideo)

                    {

                        isFirstVideo = false;

                        window.setTimeout(function () {

                            $('.videosContainer').addClass('displayed');

                        }, 570);

                    } else

                    {

                        $('.videosContainer').addClass('displayed');

                        $('#video').addClass('selected');

                    }

                }



                if (event.data === YT.PlayerState.ENDED) {

                    player.setPlaybackQuality('highres');

                    player.playVideo();

                }

            }

        };



        this.teams = function () {

            var canWheel = true;

            $('#breweryTeams .itemsContainer').owlCarousel({

                goToFirst: false,

                items: 3,

                pagination: false,

                itemsDesktop: [1199, 3],

                itemsDesktopSmall: [979, 2],

                beforeMove: function () {

                    $('#breweryTeams .sliderArrows div').removeClass('disabled');

                    if (this.currentItem == 0)

                    {

                        $('#breweryTeams .sliderArrows .left').addClass('disabled');

                    } else if (this.itemsAmount - this.visibleItems.length == this.currentItem)

                    {

                        $('#breweryTeams .sliderArrows .right').addClass('disabled');

                    }

                }

            });

            var owl = $('#breweryTeams .itemsContainer').data('owlCarousel');



            var timeout;

            function onResize()

            {

                if ($('#breweryTeams .itemsContainer .item').length > owl.visibleItems.length)

                {

                    $('#breweryTeams .sliderArrows').addClass('display');

                } else

                {

                    $('#breweryTeams .sliderArrows').removeClass('display');

                }

            }

            $(window).on('resize', function () {

                onResize();

                window.clearTimeout(timeout);

                timeout = window.setTimeout(onResize, 500);

            });

            onResize();





            $('#breweryTeams .sliderArrows div').on(CLICK_EVENT, function () {

                if (!$(this).hasClass('disabled'))

                {

                    if ($(this).hasClass('right'))

                    {

                        owl.next();

                    } else

                    {

                        owl.prev();

                    }

                }

            });



            $('#breweryTeams .itemsContainer').on('mousewheel', function (e) {

                if (canWheel)

                {

                    canWheel = false;

                    window.setTimeout(function () {

                        canWheel = true;

                    }, 250);

                    var evt = e.originalEvent || e;

                    var deltaY = evt.deltaY || (-1 / 40 * evt.wheelDelta); //wheel || mousewheel

                    if (deltaY > 0)

                    {

                        owl.next();

                    } else

                    {

                        owl.prev();

                    }

                }

            });

        };



        this.teamDetails = function () {

            if (window.innerWidth > 960) {
                var scroller = new IScroll('#breweryTeamDetails:last-child > .text:last-child', {
                    click: true,
                    probeType: 3,
                    mouseWheel: true,
                    eventPassthrough: 'horizontal',
                    scrollX: false
                });
            }

        };



        this.visit = function () {



            if ($('#breweryVisit > .content').length > 0)

            {

                $(window).on('resize', function () {

                    var height = $(window).height();



                    $('#breweryVisit .slide.header').css({

                        minHeight: height,

                        lineHeight: height + 'px'

                    });

                }).trigger('resize');



                var scroller = new IScroll('#breweryVisit > .content', {
                    click: true,
                    probeType: 3,
                    mouseWheel: true,
                    eventPassthrough: 'horizontal',
                    scrollX: false
                });

                $('a.scroll-down').click(function (e) {
                    e.preventDefault();
                    scroller.scrollBy(0, $($(this).attr('href')).offset().top * -1, 500);
                });


                data.formValidatorData = window.formValidatorData;


                var formValidator = new mca.components.FormValidator($('#breweryVisit > .content form'));


                function check(pErrors)

                {

                    var out = false;

                    $('#breweryVisit > .content form').find('input, textarea').removeClass('error');

                    $('#breweryVisit > .content form .errorMessage span').hide();

                    $('#breweryVisit > .content form .errorMessage').removeClass('display');



                    if (pErrors.length == 0)

                    {

                        out = true;

                    } else

                    {

                        $(pErrors).each(function () {

                            this.item.addClass('error');

                        });

                        var error = 'notEmpty';

                        if (pErrors.length == 1 && pErrors[0].message == 'email')

                        {

                            error = 'email';

                        }

                        $('#breweryVisit > .content form .errorMessage span.' + error).show();

                        $('#breweryVisit > .content form .errorMessage').addClass('display');

                    }

                    return out;

                }

                var wait = false;

                formValidator.submit(function (pErrors) {

                    if (wait) return false;



                    var out = false;

                    out = check(pErrors);



                    if (out)

                    {

                        wait = true;

                        $('#breweryVisit > .content form input[name="username"]').val('contact');

                        mvc.views.loader.show();

                        var formData = $('#breweryVisit > .content form').serialize();

                        formData = 'ajaxContactForm=1&' + formData;

                        $.ajax({

                            type: 'post',

                            url: $('#breweryVisit > .content form').attr('action'),

                            data: formData,

                            success: function () {

                                mvc.views.loader.hide();

                                $('#breweryVisit > .content form').find('input, textarea').val('');

                                $('.submitAndMessage').stop().animate({

                                    opacity: 0

                                }, 300, function () {

                                    $('#breweryVisit > .content form .submitAndMessage').hide();

                                    $('#breweryVisit > .content form .ok').css({

                                        display: 'block',

                                        opacity: 0

                                    }).stop().animate({

                                        opacity: 1

                                    }, 300);

                                    window.setTimeout(function () {

                                        $('#breweryVisit > .content form .ok').stop().animate({

                                            opacity: 0

                                        }, 300, function () {

                                            $('#breweryVisit > .content form .ok').hide();

                                            $('#breweryVisit > .content form .submitAndMessage').css({

                                                display: 'block',

                                                opacity: 0

                                            }).stop().animate({

                                                opacity: 1

                                            }, 300, function () {

                                                wait = false;

                                            });

                                        });

                                    }, 1300);

                                });



                            }

                        });

                    }



                    return false;

                }).change(function (pErrors) {

                    check(pErrors);

                    return false;

                });

            }


        };

        this.brewery = function () {
            if ($('#breweryBrewery > .content').length > 0) {

                $(window).on('resize', function () {

                    var height = $(window).height();


                    $('#breweryBrewery .slide.header').css({

                        minHeight: height,

                        lineHeight: height + 'px'

                    });

                }).trigger('resize');


                if (window.innerWidth > 960) {
                    var scroller = new IScroll('#breweryBrewery > .content', {
                        click: true,
                        probeType: 3,
                        mouseWheel: true,
                        eventPassthrough: 'horizontal',
                        scrollX: false
                    });
                }

                $('a.scroll-down').click(function (e) {
                    e.preventDefault();
                    scroller.scrollBy(0, $($(this).attr('href')).offset().top * -1, 500);
                });

                // swipe beer

                var swipeTeam = new Swipe(document.getElementById('swipeTeam'), {

                    speed: 1200,

                    auto: false,

                    continuous: true,

                    disableScroll: false,

                    stopPropagation: false,

                    callback: function (index, elem) {},

                    transitionEnd: function (index, elem) {}
                });

                $('.swipe-btns a').on('click', function (e) {
                    e.preventDefault();
                    if (this.dataset.action == 'next') {
                        swipeTeam.next();
                    } else {
                        swipeTeam.prev();
                    }
                });
            }
        };

        this.access = function () {
            if ($('#breweryAccess > .content').length > 0) {

                $(window).on('resize', function () {

                    var height = $(window).height();

                }).trigger('resize');

                var scroller = new IScroll('#breweryAccess > .content', {
                    click: true,
                    probeType: 3,
                    mouseWheel: true,
                    eventPassthrough: 'horizontal',
                    scrollX: false
                });
            }


            $('#formBreweryAccess').on('submit', function (e) {
                e.preventDefault();

                var elements = [
                ['#firstname', '#firstname'],
                ['#lastname', '#lastname'],
                ['#message', '#message']
            ];

                var addConditions = [
                ["if($('#email').val() == '') { tabErrors.push('#email');} else { if(validateEmail($('#email').val())){ $('#email').css('border-bottom', '2px solid #000'); } else { tabErrors.push('#email');}}"],
            ];

                var returnForm = validateForm(elements, e, addConditions);

                if (returnForm) {

                    $.ajax({
                        data: $(this).serialize(),
                        method: 'post',
                        url: $(this).attr('action'),
                        dataType: 'json',
                        success: function (data) {

                            if (data == '1') {
                                $('#formBreweryAccess').find('.ok').fadeIn();
                                $('#formBreweryAccess').find('.notEmpty').css('display', 'none');

                            } else if (data == '2') {
                                $('#formBreweryAccess').find('.notEmpty').fadeIn();
                                $('#formBreweryAccess').find('.ok').css('display', 'none');
                            }

                        }
                    });

                    $('#formBreweryAccess')[0].reset();
                }

            });

        };

        // Map _________________________________________________________________________________________________________
        var map,
            mapDom = document.getElementById("map"),
            marker,
            draggable = true,
            markerIcon = 'marker',
            scrollwheel = true;

        if (window.screenWidth > 1024) {
            //markerIcon = 'marker-image';
            //draggable = true;
            //scrollwheel = true;
        };


        function initialisation() {
            var styles = [{
                    "stylers": [{
                        "hue": "#ff1a00"
                    }, {
                        "invert_lightness": true
                    }, {
                        "saturation": -100
                    }, {
                        "lightness": 33
                    }, {
                        "gamma": 0.5
                    }]
                }, {
                    "featureType": "water",
                    "elementType": "geometry",
                    "stylers": [{
                        "color": "#2D333C"
                    }]
                }],
                mapCenter = new google.maps.LatLng(46.1014007, 7.0822127),
                optionsCarte = {
                    zoom: 14,
                    //zoomControl : false,
                    streetViewControl: false,
                    center: mapCenter,
                    scrollwheel: scrollwheel,
                    draggable: draggable,
                    mapTypeControl: false,
                    styles: styles
                },
                markerLogo = new google.maps.MarkerImage('../static/img/' + markerIcon + '.png');

            map = new google.maps.Map(mapDom, optionsCarte);
            marker = new google.maps.Marker({
                url: 'https://goo.gl/maps/RXJ5oYDe9Lo',
                position: mapCenter,
                map: map,
                icon: markerLogo,
                title: 'Voir sur Google Maps'
            });

            google.maps.event.addListener(marker, 'click', function () {
                window.open(marker.url, '_blank')
            });
        }

        if (mapDom) {
            initialisation();
        };


    });;

