/* ../mvc/controllers/experience.js */
mvc.controllers.experience = new(function () {
    var that = this;

    this.scroll;

    this.index = function () {
        that.scroll = new IScroll('#experienceIndex .contentInner', {
            click: true,
            probeType: 3,
            mouseWheel: true,
            eventPassthrough: 'horizontal',
            scrollX: false
        });

        $('#content #experienceIndex .top .submenu span').on(CLICK_EVENT, function () {
            var $this = $(this);
            var id = $this.data('id');

            if ($this.hasClass('current')) return false;

            $('#content #experienceIndex .top .submenu span').removeClass('current');
            $this.addClass('current');

            if (id == 'discover') {
                $('#experienceIndex .discover').find('.continue, h3, h2').css({
                    opacity: 1
                });
                $('#experienceIndex .discover').css({
                    scale: 1.2,
                    opacity: 0,
                    display: 'block'
                }).stop().animate({
                    scale: 1,
                    opacity: 1
                }, 700, 'easeInOutCubic');
            } else {
                // Cacher le contenu courant
                $('#content #experienceIndex .experienceContents .experienceContent.selected .toScale').stop().animate({
                    y: -50,
                    scale: 0.8
                }, 400, 'easeOutCubic');
                $('#content #experienceIndex .experienceContents .experienceContent.selected').stop().animate({
                    opacity: 0
                }, 400, 'easeOutCubic', function () {
                    $(this).removeClass('selected');

                    var $newContent = $('#content #experienceIndex .experienceContents .experienceContent[data-id="' + id + '"]');
                    $newContent.addClass('selected');
                    $(window).trigger('resize');
                    $newContent.find('.toScale').css({
                        y: 50,
                        scale: 1.2
                    }).stop().animate({
                        y: 0,
                        scale: 1
                    }, 400, 'easeOutCubic');
                    $newContent.css({
                        opacity: 0
                    }).stop().animate({
                        opacity: 1
                    }, 400, 'easeOutCubic');


                    that.scroll.refresh();
                });
            }
            that.scroll.scrollTo(0, 0, 300);


            return false;
        });

        that._discover();

        that._gallery();

        $('#experienceIndex').stop().css({
            scale: 1.2
        }).delay(400).animate({
            scale: 1
        }, 1400, 'easeOutCubic');
    };

    this._discover = function () {
        var timeout;
        $('#experienceIndex .discover .continue').on(CLICK_EVENT, function () {
            // check selected
            var selected = $('#content #experienceIndex .experienceContents .experienceContent.selected').data('id');
            $('#content #experienceIndex .top .submenu span').removeClass('current').filter('[data-id="' + selected + '"]').addClass('current');

            var $items = $('#experienceIndex .discover').find('.continue, h3, h2');
            var i;
            var delay = 0;
            for (i = $items.length - 1; i >= 0; i--) {
                $($items[i]).stop().delay(delay).animate({
                    opacity: 0
                }, 300, 'easeOutCubic');
                delay += 200;
            }
            $('#experienceIndex .discover').stop().delay(500).animate({
                scale: 1.2,
                opacity: 0
            }, 700, 'easeInOutCubic', function () {
                $(this).hide();
            });

            return false;
        });
    };

    this._gallery = function () {
        if ($('#experienceContentGallery').length > 0) {
            var currentIndex = 0;

            function update() {
                $('#content #experienceIndex .experienceContents #experienceContentGallery .num .current').text(currentIndex + 1);

                $('#experienceContentGallery .sliderArrows > div').removeClass('disabled');
                if (currentIndex == 0) {
                    $('#experienceContentGallery .sliderArrows > div.left').addClass('disabled');
                } else if (currentIndex == $('#experienceContentGallery .images img').length - 1) {
                    $('#experienceContentGallery .sliderArrows > div.right').addClass('disabled');
                }
                $('#experienceContentGallery .images img').css({
                    zIndex: 1
                }).filter('.current').css({
                    zIndex: 2
                });
                $('#experienceContentGallery .images img').eq(currentIndex).css({
                    zIndex: 3,
                    opacity: 0
                }).stop().animate({
                    opacity: 1
                }, 400, 'easeOutCubic', function () {
                    $('#experienceContentGallery .images img').removeClass('current').css({
                        zIndex: 1
                    });
                    $(this).css({
                        zIndex: 3
                    }).addClass('current');
                })
            }

            $('#experienceContentGallery .sliderArrows > div').on(CLICK_EVENT, function (e) {
                //e.preventDefault();

                if ($(this).hasClass('disabled')) return false;

                if ($(this).hasClass('left')) {
                    currentIndex--;
                } else {
                    currentIndex++;
                }

                update();
            });

            $("#experienceContentGallery .images").swipe({
                //Generic swipe handler for all directions
                swipe: function (event, direction, distance, duration, fingerCount, fingerData) {
                    var button;
                    if (direction == 'left') {
                        button = $('#experienceContentGallery .sliderArrows > div.right');
                    } else {
                        button = $('#experienceContentGallery .sliderArrows > div.left');
                    }
                    button.trigger(CLICK_EVENT);
                },
                //Default is 75px, set to 0 for demo so any distance triggers swipe
                threshold: 0
            });
        }
    };
});;

