mvc.controllers.taproom = new(function ()

    {

        var that = this;

        this.index = function () {


            $("#taproomSlider").owlCarousel({
                items: 1,
                singleItem: true,
                navigation: true,
                slideSpeed: 500,
                pagination: false
            });


            if (window.innerWidth > 960) {
                var scroller = new IScroll('#taproom  .content', {
                    click: true,
                    probeType: 3,
                    mouseWheel: true,
                    eventPassthrough: 'horizontal',
                    scrollX: false
                });
            }


            $('a.scroll-down').click(function (e) {
                e.preventDefault();
                scroller.scrollBy(0, $($(this).attr('href')).offset().top * -1, 500);
            });

            $(document).on('mouseenter', '.selector', function () {
                $(this).find('ul').stop();
                $(this).find('ul').slideDown(300);
            });
            $(document).on('mouseleave', '.selector', function () {
                $(this).find('ul').stop();
                $(this).find('ul').slideUp(300);
            })

            $('.selector').find('a').on('click', function (e) {

                e.preventDefault();
                var txt = $(this).text();
                $('.selector > p >i').text(txt);
                $('.selector .active').removeClass('active');
                $(this).parent('li').addClass('active');
                var c = $(this).attr('href');
                scroller.scrollBy(0, $($(this).attr('href')).offset().top * -1, 500);
            })

            var controller = new ScrollMagic.Controller();
            $(".animScrollTitle").each(function (index, elem) {
                new ScrollMagic.Scene({
                        triggerElement: elem,
                        triggerHook: "onTop",
                        offset: '-' + $(window).height() / 3 + '%'

                    })
                    .setClassToggle(elem, 'onScreen')
                    .addTo(controller)
            });
            $(".animScrollTop").each(function (index, elem) {
                new ScrollMagic.Scene({
                        triggerElement: elem,
                        triggerHook: "onTop",
                        offset: '-' + $(window).height() / 3 + '%'

                    })
                    .setClassToggle(elem, 'onScreen')
                    .addTo(controller)
            });


            // Envoie du formulaire
            $('#formBook').on('submit', function (e) {
                e.preventDefault();

                var elements = [
                ['#firstname', '#firstname'],
                ['#lastname', '#lastname'],
                ['#nb', '#nb'],
                ['#date', '#date']
            ];

                var addConditions = [
                ["if($('#email').val() == '') { tabErrors.push('#email');} else { if(validateEmail($('#email').val())){ $('#email').css('border-bottom', '2px solid #000'); } else { tabErrors.push('#email');}}"],
            ];

                var returnForm = validateForm(elements, e, addConditions);

                if (returnForm) {

                    $.ajax({
                        data: $(this).serialize(),
                        method: 'post',
                        url: $(this).attr('action'),
                        dataType: 'json',
                        success: function (data) {

                            if (data == '1') {
                                $('#reserver').find('.ok').fadeIn();
                                $('#reserver').find('.error').css('display', 'none');

                            } else if (data == '2') {
                                $('#reserver').find('.error').fadeIn();
                                $('#reserver').find('.ok').css('display', 'none');
                            }

                        }
                    });

                    $('#formBook')[0].reset();
                }

            });




        };

    });;